script: |
  super -f text -I q11283.spq | sort > q11283.out

inputs:
  - name: q11283.spq
    data: |
      SELECT ALL - 51 AS col2 FROM tab0 (FORMAT parquet) WHERE NOT 10 * + 35 * 13 BETWEEN + + CAST ( + col2 AS INTEGER ) AND + col0;
  - name: tab0

outputs:
  - name: q11283.out
    data: |
      -51
      -51
      -51
